import React, { useState, useEffect } from "react";
import { getPayouts } from "../services/api"; // API ดึงข้อมูล Payouts
import "bootstrap/dist/css/bootstrap.min.css";

const Payouts = () => {
    const today = new Date();
    const currentMonth = today.toISOString().slice(0, 7); // Format YYYY-MM

    const [payouts, setPayouts] = useState([]);
    const [selectedMonth, setSelectedMonth] = useState(currentMonth);
    const [loading, setLoading] = useState(false);

    // ✅ ฟังก์ชันโหลดข้อมูล
    const fetchPayouts = async () => {
        try {
            setLoading(true);

            // ✅ คำนวณ StartDate และ EndDate จาก selectedMonth
            const startDate = `${selectedMonth}-01`;
            const endDate = new Date(selectedMonth);
            endDate.setMonth(endDate.getMonth() + 1);
            endDate.setDate(0); // ✅ หาวันสุดท้ายของเดือนที่เลือก
            const formattedEndDate = endDate.toISOString().split("T")[0];

            console.log(`📌 Fetching Payouts for month: ${selectedMonth} (${startDate} to ${formattedEndDate})`);

            // ✅ ส่ง request ไปที่ API
            const res = await getPayouts({
                start_date: startDate,
                end_date: formattedEndDate,
            });

            setPayouts(res.data);
        } catch (error) {
            console.error("🔴 Error fetching payouts:", error);
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchPayouts(); // ✅ โหลดข้อมูลเมื่อ Component เริ่มต้น
    }, [selectedMonth]);

    return (
        <div className="container mt-4">
            <h1>📉 รายจ่าย</h1>
            <div className="card p-3 mb-3 shadow">
                <div className="row">
                    <div className="col-md-4">
                        <label className="form-label">เลือกเดือน</label>
                        <input 
                            type="month" 
                            className="form-control"
                            value={selectedMonth}
                            onChange={(e) => setSelectedMonth(e.target.value)}
                        />
                    </div>
                    <div className="col-md-2 d-flex align-items-end">
                        <button className="btn btn-primary w-100" onClick={fetchPayouts}>
                            🔍 ค้นหา
                        </button>
                    </div>
                </div>
            </div>

            {/* แสดงข้อมูลรายจ่าย */}
            <div className="card p-3 shadow">
                <h5>📋 รายการรายจ่าย ประจำเดือน {selectedMonth}</h5>
                {loading ? (
                    <div className="text-center py-3">⏳ กำลังโหลดข้อมูล...</div>
                ) : (
                    <table className="table table-hover">
                        <thead className="table-dark">
                            <tr>
                                <th>วันที่</th>
                                <th>ประเภท</th>
                                <th>รายละเอียด</th>
                                <th>จำนวนเงิน</th>
                            </tr>
                        </thead>
                        <tbody>
                            {payouts.length > 0 ? (
                                payouts.map((payout, index) => (
                                    <tr key={index}>
                                        <td>{new Date(payout.payout_date).toLocaleDateString()}</td>
                                        <td>{payout.payout_type}</td>
                                        <td>{payout.description}</td>
                                        <td>{payout.amount.toFixed(2)} ฿</td>
                                    </tr>
                                ))
                            ) : (
                                <tr>
                                    <td colSpan="4" className="text-center text-muted">ไม่มีข้อมูลรายจ่าย</td>
                                </tr>
                            )}
                        </tbody>
                    </table>
                )}
            </div>
        </div>
    );
};

export default Payouts;
